import axios from "axios";
import React, { useEffect, useState } from "react";

function B2Bsheet() {
  const [state, setstate] = useState(null);

  useEffect(() => {
    axios
      .get("https://tender-bear-baseball-cap.cyclic.app/salesB2C")
      .then((data) => setstate(data));
  }, []);

  return (
    <div>
      {state === null ? (
        <h3>no data avalibale </h3>
      ) : (
        state.map((v) => (
          <div>
            <h3>{v.CancelationPolicy}</h3>
            <h3>{v.CheckIn}</h3>
            <h3>{v.CheckOut}</h3>
            <h3>{v.HotelName}</h3>
            <h3>{v.Nationality}</h3>
            <h3>{v.Note}</h3>
            <h3>{v.NumberOfPax}</h3>
            <h3>{v.NumberOfUnits}</h3>
            <h3>{v.Price}</h3>
            <h3>{v.RoomType}</h3>
          </div>
        ))
      )}
    </div>
  );
}

export default B2Bsheet;
